from transformers import pipeline

classifier = pipeline("text-classification", model="fakespot-ai/roberta-base-ai-text-detection-v1")

text = "so i've been thinking a lot lately about how much has changed since i started college. back in high school everything felt so structured, like every day was basically the same. wake up, go to school, come home, do homework, repeat. and i kind of hated it at the time but looking back it was actually really nice to just not have to think about stuff. now i have to figure out literally everything myself and nobody really prepares you for that.like last semester i completely bombed my midterms because i didn't realize how different college studying is. in high school you could just read the textbook the night before and be fine. here i spent three days studying and still barely passed. my roommate told me i was studying wrong which was kind of annoying to hear but she was probably right. i was just rereading my notes over and over instead of actually testing myself on the material.the social stuff is weird too. i thought i'd automatically make friends because there are so many people around but it's actually kind of lonely sometimes. everyone already seems to have their own thing going on. i joined a club in october which helped a little but i still feel like an outsider half the time. my friend from back home says it gets better by sophomore year but that feels really far away right nowalso the food situation is rough. the dining hall is fine i guess but eating the same rotating menu every week gets old fast. i tried cooking in the dorm kitchen once and nearly set off the fire alarm making pasta which was genuinely embarrassing. my mom keeps offering to send care packages and i keep saying no because i want to feel independent but honestly at this point i would not say no to some home cooking.i don't know, college is just not what i expected. not in a bad way necessarily, just different. i think i had this idea that everything would click into pl"
result = classifier(text)
print(result)